package primitives_test

import (
	"encoding/hex"
	"github.com/olympus-protocol/ogen/pkg/primitives"
	testdata "github.com/olympus-protocol/ogen/test"
	"github.com/stretchr/testify/assert"
	"testing"
)

func TestBlock(t *testing.T) {
	correct := testdata.FuzzBlock(2, true, true)
	for _, b := range correct {
		ser, err := b.Marshal()
		assert.NoError(t, err)

		desc := new(primitives.Block)
		err = desc.Unmarshal(ser)
		assert.NoError(t, err)

		assert.Equal(t, b, desc)
	}

	incorrect := testdata.FuzzBlock(2, false, true)
	for _, b := range incorrect {
		_, err := b.Marshal()
		assert.NotNil(t, err)

	}

	nilpointers := testdata.FuzzBlock(2, true, false)
	for _, b := range nilpointers {
		assert.NotPanics(t, func() {
			data, err := b.Marshal()
			assert.NoError(t, err)

			n := new(primitives.Block)
			err = n.Unmarshal(data)
			assert.NoError(t, err)

			assert.Equal(t, b, n)

			assert.Equal(t, uint64(0), n.Header.Slot)
		})

	}
}

func TestBlocksMerkle(t *testing.T) {
	// Serialized snappy compressed block
	blockRaw, err := hex.DecodeString("")

	assert.NoError(t, err)

	b := new(primitives.Block)
	err = b.Unmarshal(blockRaw)
	assert.NoError(t, err)

	assert.Equal(t, "6df71ef97e215beb7a85ec1f2d67f7d1360137eaa293cd95689ba0c6a108bb7f", b.VotesMerkleRoot().String())
	assert.Equal(t, "79477cff74df995c6c408ea95e6c4a917f2908226d5abfbdc4fde799d9ffde83", b.TransactionMerkleRoot().String())
	assert.Equal(t, "0eee170168ae36bd6d6501353ebb6f89243ab0cfa44e09ba30e0d4b3e000246d", b.TransactionMultiMerkleRoot().String())
	assert.Equal(t, "18468e73f4be6a87949b3b3763bf0131a46745be8690a8b500941e449dbf9550", b.DepositMerkleRoot().String())
	assert.Equal(t, "3b4057c4e02ebe746171b4feeb90d8715948a81921820fccbfcc9417a8fb0619", b.ExitMerkleRoot().String())
	assert.Equal(t, "c967a66ef08b9bbeadb9a384e889556d8aa10eb9288e81406f79e1f73e54f8c7", b.VoteSlashingRoot().String())
	assert.Equal(t, "811cfa910b2095cf6eee2653c218e9dd2170f42b4641da12f3f122ba0607227d", b.RANDAOSlashingsRoot().String())
	assert.Equal(t, "c72bcd1cec8619f8137729bc3c75379eb1ca019c1b9dbe73506ba0d2e3cfab84", b.ProposerSlashingsRoot().String())
	assert.Equal(t, "0ed57984cbe7acd01fe0f3f58e3a0d367707857ad848d454385764bccffc3a8d", b.GovernanceVoteMerkleRoot().String())
	assert.Equal(t, "45b0a163f717f454220c3e7cf09b067fe0eb32a34a6944eaa73070d64dfbcbd5", b.CoinProofsMerkleRoot().String())
	assert.Equal(t, "7e7fc88c9f523da3a4d08f420d0e978e5acd98aa28d51ba434e135c3f9c1c3ee", b.PartialExitsMerkleRoot().String())

	expectedTx := []string{"fe39080bf87a5cb1e10a2b8cc757068835d917bd76859283c957146e35c4c337", "2ab7507941b7eaf0d9c2fbd28d0a7ab1ce3dc96d5ad27613d8558d943ad8818a"}
	txs := b.GetTxs()

	assert.Equal(t, expectedTx, txs)
}
